let coin = {
    state: 0,
    flip: function() {
        coin.state = Math.round(Math.random());
        return this.state
    },
    toString: function() {
        if (coin.state == 0) {
            return coin.state = "heads"
        } else if (coin.state == 1) {
            return coin.state = "tails"
        }
            
        
    },
    toHTML: function() {
        let image = document.createElement('img');
        image.className = 'img'
        if (coin.state == 0) {
            image.src = 'data:image/jpeg;base64,'
        } else if (coin.state == 1) {
            image.src = 'data:image/jpeg;base64,'
        }
        return document.body.appendChild(image);
    }
};


function display20Flips(params) {
    for (let index = 0; index < 20; index++) {
        coin.flip()
        coin.toString()
        const string = document.createElement('h1')
        string.append(coin.state)
        document.body.appendChild(string)
        
    }
    
}

function display20images(params) {
    for (let index = 0; index < 20; index++) {
        coin.flip()
        coin.toHTML()
        
    }
    
}

console.log(display20Flips())
console.log(display20images())